INSERT INTO `tbl_question` (`question_id`, `section_id`, `question`, `question_image`, `option_id`, `reference_id`, `display`) VALUES
(1, 1, 'हया मेमोरी डिवाईस मध्ये मोठया प्रमाणात माहिती साठवता येते.			', NULL, 2, NULL, 'Y'),
(2, 1, 'ॲनालॅटीकल इंजिन चा निर्माता,………. हया व्यक्तीला आधुनिक डिजीटल कॉम्प्युटर जा जनक म्हणतात 			', NULL, 5, NULL, 'Y'),
(3, 1, 'फस्ट जनरेशन च्या कॉम्प्युटर्समध्ये………. चा वापर केला होता.			', NULL, 9, NULL, 'Y'),
(4, 1, 'सेकंड जनरेशन च्या कॉम्प्युटर्स मध्ये…….. चा वापर केला होता.			', NULL, 13, NULL, 'Y'),
(5, 1, 'थर्ड जनरेशन च्या कॉम्प्युटर्स मध्ये……… चा वापर केला होता.			', NULL, 19, NULL, 'Y'),
(6, 1, '…… डिवाइस ने आपल्याला कॉम्प्युर्स्र ला डाटा व इनस्ट्रकशन्स फीड करता येतात', NULL, 21, NULL, 'Y'),
(7, 1, '…… डिवाइस ने आपल्याला कॉम्प्युर्स्रकडून रीझल्ट व इनफॅारमेन्शन मिळवू शकतो.			', NULL, 28, NULL, 'Y'),
(8, 1, 'कॉम्प्युटसच्या ……….. या युनिट मध्ये ॲक्चुअल डाटा प्रोसेसिंग चे काम चालते.			', NULL, 32, NULL, 'Y'),
(9, 1, '…… युनिट हे कॉम्प्युटरच्या इतर भागांवर नियंत्रण ठेवण्याचे काम करते.			', NULL, 34, NULL, 'Y'),
(10, 1, 'कंट्रोल युनिट आणि ऐरिथम्याटिकल आणि लॉजिकल या दोन्ही युनिटसूचे काम ………. डिवाइस करते.			', NULL, 40, NULL, 'Y'),
(11, 1, '…… ला कॉम्प्युटर्सचा ब्रेन असे म्हणतात.			', NULL, 41, NULL, 'Y'),
(12, 1, '…….. या कॉम्प्युटर्स चा साईज र्ब्रीफकेस मध्ये बसू शकेल एवढा लहान असतो.			', NULL, 47, NULL, 'Y'),
(13, 1, '…… या प्रकारचे कॉम्प्युटर्स, पर्सनल डिजीटल असिस्‍टंट या नावानेही ओळखले जातात.			', NULL, 50, NULL, 'Y'),
(14, 1, '…… या प्रकारची डीवाइस, युझर कडून दिला जाणारा डाटा व इनस्ट्रक्शन, इलेकट्रॉनिक्स सिगनल मध्ये कन्व्हर्ट करण्याचे काम करतात.			', NULL, 54, NULL, 'Y'),
(15, 1, '……..चा वापर पेपर वर आउटपुट प्रिंन्ट करण्यासाठी होतो.			', NULL, 57, NULL, 'Y'),
(16, 1, '…….. उपयोग कॉम्प्युटर ला इनपुट देण्यासाठी होतो.			', NULL, 63, NULL, 'Y'),
(17, 1, '……. चा वापर कॉम्प्युटरमध्ये आइटम्स किंवा ऑपशन सिलेक्ट करण्यासाठी होतो.			', NULL, 65, NULL, 'Y'),
(18, 1, '……. च्या स्क्रीन वर कॉम्प्युटर मधील इन्फर्मेशन पाहता येते.			', NULL, 70, NULL, 'Y'),
(19, 1, 'कॉम्प्युटससाठी कीबोर्ड आणि …….. ही कॉमन इनपुट डीवाइस आहेत.			', NULL, 75, NULL, 'Y'),
(20, 1, 'कॉम्प्युटसच्या भाषेतील डाटा मानवाला समजणाऱ्या भाषेत ट्रान्सलेट करावयाचे काम………. डिवाइस करतात.			', NULL, 80, NULL, 'Y'),
(21, 1, 'मॉनिटर आणि ……… ही कॉमन आउटपुट डीवाईस आहेत.			', NULL, 81, NULL, 'Y'),
(22, 1, 'कीबोर्ड ची मदत न घेता कॉम्प्युटरमध्ये थेट साहिती भरण्याच्या प्रक्रियेला ….. इनट्री असे म्हणतात.			', NULL, 85, NULL, 'Y'),
(23, 1, 'माउस हे …….. प्रकारचे डिवाइस आहेत.			', NULL, 89, NULL, 'Y'),
(24, 1, 'वेगवेगळया ॲप्ल‍िकेशन्स प्रमाणे माउस पॉइन्टर शेप बदलत असतो.			', NULL, 93, NULL, 'Y'),
(25, 1, 'ऑब्जेक्ट सीलेक्ट करण्यासाठी माउस चे ……….. बटन सिंगल क्लीक करावे.			', NULL, 96, NULL, 'Y'),
(26, 1, 'कॉम्प्युटर वर गेम्स खेळताना दिशा बदलण्यासाठी …….. या डिवाइस चा इनपुट डिवाइस म्हणून उपयोग होतो.			', NULL, 98, NULL, 'Y'),
(27, 1, 'स्कॅनिंग डिवाइस हे ………एन्‍ट्री प्रकारचे डिवाइस आहे.			', NULL, 102, NULL, 'Y'),
(28, 1, '……… या प्रकारच्या स्कॅनर मध्ये इमेज ही ग्लास सरफेस वर ठेवली जाते व ती खालच्या बाजूने स्कॅन होते.			', NULL, 107, NULL, 'Y'),
(29, 1, '….. हे एक प्रकारचे हातात मावणारे यंत्र असेत, जे इमेज च्या वरून फिरवले असता कॉम्प्युटरमध्ये डाटा ची डिरेक्ट इन्ट्री केली जाते.			', NULL, 113, NULL, 'Y'),
(30, 1, 'टेक्स्‍ट मॅटर स्कॅन करण्यासाठी …… हा अत्यंत लहान आकाराचा स्कॅनर वापरतात.			', NULL, 117, NULL, 'Y'),
(31, 1, '…….. यांना फोटोइलेक्ट्रोनिक स्कॅनर्स असे म्हणतात.			', NULL, 121, NULL, 'Y'),
(32, 1, 'मशिन रीडेबल फॅार्म मध्ये डाटा कनव्हर्ट करण्याचे काम ………. प्रकारची डिवाईस करतात. 			', NULL, 122, NULL, 'Y'),
(33, 1, 'इन्टर्नल मेमोरी ला …….. मेमोरी असेही म्हणतात.			', NULL, 126, NULL, 'Y'),
(34, 1, 'कॉम्प्युटर ऑफ केल्यानंतरही डाटा …….. डिवाइस मध्ये आहे तसाच स्टोर्ड राहतो.			', NULL, 129, NULL, 'Y'),
(35, 1, '……. डिस्क ही सेकंडरी मेमोरी चा प्रकार आहे.			', NULL, 132, NULL, 'Y'),
(36, 1, 'हे डिवाइस एका कॉम्प्युटरवरून दुसऱ्या कॉम्प्युटरवर डाटा ट्रान्सफर करण्यासाठी वापरले जाते.			', NULL, 136, NULL, 'Y'),
(37, 1, '…….. डिस्क ही मोठया प्रमाणातील डाटा साठविण्यासाठी वापरतात.			', NULL, 142, NULL, 'Y'),
(38, 1, '<p>&hellip;&hellip;.. डीस्कस वापरण्यासाठी लेझर टेक्नॉलॉजी चा उपयोग केला जातो.</p>\r\n', NULL, 144, 0, 'Y');
